css:
.vertical atom-pane-container atom-pane {
  flex-direction: row;
}
.vertical .tab-bar {
  width: 14em;
  max-width: 14em;
  min-width: 14em;
  height: auto !important;
  padding: 0 !important;
  flex-direction: column !important;
  overflow: auto !important;
  display: block !important;
  box-shadow: none;
}
.vertical .tab-bar::-webkit-scrollbar {
  display: unset !important;
}
.vertical .tab-bar .tab {
  width: 100% !important;
  height: auto !important;
  flex-grow: 0 !important;
  border: none;
}
.vertical .tab-bar .tab:last-of-type {
  box-shadow: none;
}
.vertical .tab-bar .tab .title {
  text-align: left !important;
}
.vertical .tab-bar .tab .close-icon {
  margin-right: 5% !important;
}
.vertical .tab-bar .placeholder {
  display: block !important;
  height: 1px !important;
}
.vertical .tab-bar .placeholder::before,
.vertical .tab-bar .placeholder::after {
  display: none !important;
}
